import React, {Component} from 'react';

export default class ItemStatusFilter extends Component{

    changeProperty = (e) => {

    }

    onLabelChange = (e) => {
        this.setState({
            label: e.target.value
        });
    };

    render() {
        return(



            <div className="btn-group">
                <button
                    type="button"
                        className="btn btn-info all"
                        onClick={this.changeProperty}
                >
                    All
                </button>


                <button
                    type="button"
                    className="btn btn-outline-secondary act"
                    onClick={this.changeProperty}
                >
                    Active
                </button>


                <button
                    type="button"
                    className="btn btn-outline-secondary done"
                    onClick={this.changeProperty}
                >
                    Done
                </button>


            </div>

        )
    }

}
